Тривожна сирена. Що робити, якщо вона лунає? 

Якщо сигнал тривожних сирен та надзвичайна ситуація застали вас удома, потрібно:

• увімкнути радіоприймач та телевізор, щоб своєчасно чути розпорядження місцевої влади;
• повідомити про почуте сусідів;
• підготувати засоби індивідуального захисту органів дихання та шкіри, медичну аптечку, документи (паспорт, свідоцтво про народження дітей, документи про освіту, пенсійне посвідчення, військовий квиток тощо), гроші, засоби зв’язку, запас їжі та води, предмети особистої гігієни;
• вимкнути в будинку/квартирі газ, водопостачання, електрику;
• зачинити вікна в помешканні та ущільнити їх;
• уточнити місце знаходження найближчого укриття (підвальне приміщення, паркінг, метрополітен тощо), в якому можна сховатися.

В разі отримання повідомлення про евакуацію потрібно: 

• зібрати необхідний запас продуктів на 2-3 доби
• медикаменти
• одяг, взуття, предмети особистої гігієни
• документи, гроші, найбільш цінні речі тощо

